    "2016-03-10T06:39:49.681103",nt"name": "hazardous-material-storage-facilities-and-sites-commercial-hazardous-waste-operations",nt"isopen":
    false,nt"url": null,nt"notes": "A Commercial Hazardous Waste Operation
    is a DEP primary facility type related to the Waste Management Hazardous Waste Program.
    The sub-facility types related to Commercial Hazardous Waste Operations that are
    included are: Disposal Facility, Hazardous Generator, Recycling Facility, Storage
    Facility, and Treatment Facility._____Disposal Facility: Facility permitted by DEP
    to accept hazardous waste generated off-site, and dispose of the waste by incineration,
    or by intentionally placing the waste in or on land or water in specially designed
    and constructed containment units where it will remain after closure of the facility.
    Hazardous Generator: A site where hazardous waste is first produced. The hazardous
    waste may be accumulated on-site at this facility for a prescribed limited amount
    of time (usually between 90 and 270 days) without first obtaining a storage permit
    from the Department, as long as it is done in accordance with prescribed standards.
    Recycling Facility: Facility permitted by DEP to accept hazardous waste generated
    off-site, and treat the waste to make it suitable for upcoming recovery of a usable
    product or material. Storage Facility: Facility permitted by DEP to accept hazardous
    waste generated off-site, and hold the waste for a temporary period (not to exceed
    one year). At the end of that period the hazardous waste is treated or disposed
    of at the same facility, or treated, disposed, or stored elsewhere. Additional permitting
    is necessary if the waste is treated or disposed at the storage facility itself.
    Treatment Facility: Facility permitted by DEP to change the physical, chemical or
    biological character or composition of hazardous waste that is generated off-site.
    The purpose is to neutralize the waste, or to render the waste non-hazardous, safer
    for transport, suitable for recovery, suitable for storage, or reduced in volume.",nt"license_title":
